(1, 0, '527945068', 'Je t\'haine', 11, NULL, NULL, 'Une jeune femme est retrouvée morte à son domicile. Différents indices sèment le doute sur le tueur. L\'inspectrice Bennet arrivera-t-elle à trouver le criminel ?', NULL, '', 1, '00:03:51', NULL, '', 66, 'id :,1'),
