(8, 0, '528255015', 'Dernière rencontre', 11, NULL, NULL, 'Un homme se fait poursuivre dans les rues de Paris, il essaye d\'échapper à ses démons bien motivés à ne pas le lâcher...', NULL, '', 1, '00:05:20', NULL, NULL, 4, 'id :,1,1,1'),
(9, 0, '528255338', 'Nuage', 11, NULL, NULL, 'Stéphanie, jeune femme célibataire très complexée par l’amour et les garçons. Elle a reçu deux propositions, une de son ex et de ses amis pour sortir le jour de la Saint Valentin. Seulement elle a envie de voir personne et décide de rester seule chez elle persuadée de passer une meilleure soirée …', NULL, '', 1, '00:03:37', NULL, NULL, 31, 'id : 1,1,1,1,1');

